import { createAsyncThunk } from "@reduxjs/toolkit";
import Api from "../../Api";


export const likeProducts = createAsyncThunk('action/likes/likeProducts', async(payload) => {
    const {data} = await Api.likes(payload)
    return data
})

export const likeList = createAsyncThunk('action/likes/likeList', async() => {
    const {data} = await Api.likeList()
    return data
})
